import Header from './header';
import Footer from './footer';
import styles from '../screens/CSS/home.module.css';
import * as React from 'react';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import { Tabs, AppBar } from '@mui/material';
import { Typography } from '@mui/material';
import ProductInformation from './product';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';
import stylesProduct from '../screens/CSS/productInfor.module.css';
import imageTest from '../assets/testproduct.jpg'
import { Rating } from '@mui/material';
import { Link } from 'react-router-dom';
import ButtonChangeValue from './buttonChangeValue';
import UserRating from './userRating';
import OrderUserItem from './OrderUserItem';

function TabPanel(props) {
    const { children, value, index, statusOrder, ...other } = props;
  
    return (
      <div>
        {value === index && (
          <OrderUserItem 
            status = {statusOrder}
          />
        )}
      </div>
    );
  }

function OrderUserManager({navigation}){
    const [value, setValue] = React.useState(1);

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    return(
        <div className={styles.Home}>
            <Header navigation={navigation}/>
            <div className={styles.content} >
                <div className={styles.wraper}>
                    <p className={styles.tdisplay}> Quan ly don hang </p>
                    <Box
                    sx={{ flexGrow: 1, bgcolor: 'background.paper', display: 'flex' }}
                    >
                        <Tabs
                        value={value}
                        onChange={handleChange}
                        textColor="secondary"
                        indicatorColor="secondary"
                        aria-label="secondary tabs example"
                        orientation="vertical"
                        >
                            <Tab value={0} label="Tat ca"/>
                            <Tab value={1} label="Cho xac nhan" />
                            <Tab value={2} label="Cho lay hang"/>
                            <Tab value={3} label="Dang giao"/>
                            <Tab value={4} label="Da Huy"/>
                        </Tabs>
                        <TabPanel value={value} index={0}>        
                        </TabPanel>
                        <TabPanel value={value} index={1}>
                        </TabPanel>
                        <TabPanel value={value} index={2}>
                        </TabPanel>
                        <TabPanel value={value} index={3}>
                        </TabPanel>
                        <TabPanel value={value} index={4}>
                        </TabPanel>
                </Box> 
                </div>
            </div>
            <Footer navigation={navigation}/>
      </div>
    );
}

export default OrderUserManager;
